import React from 'react';
import styled from 'styled-components';

const HeaderContainer = styled.header`
 background-color: #000;
  color: #00f;
  padding: 20px;
  text-align: center;
  font-size: 2em;
  box-shadow: 0 0 10px #39ff14;
`;

const Header = () => {
  return (
    <HeaderContainer>
      CodersBlog
    </HeaderContainer>
  );
};

export default Header;
